import React from "react";
import styled from "styled-components";
import Search from "../icon/search-solid.svg";
// import Navbar from "./Navbar";
import { SearchBox } from "react-instantsearch-dom";
import { useHistory } from "react-router-dom";
import { BiSearch } from "react-icons/bi";
import { NavLink } from "react-router-dom";
import { FaSearch } from "react-icons/fa";
import { FiArrowRightCircle } from "react-icons/fi";
import { BsArrowRightCircle } from "react-icons/bs";

function Home() {
  const history = useHistory();

  const SearchClick = () => history.push("./SearchResult");

  const StyledWrapper = styled.div`
    ${({ flex }) => flex && "display: flex;"}
  `;
  // const SearchClick = ({url}) => {

  // }
  //다른스타일 버튼에도 재사용 할수 있게
  const CarButton = ({ primary, url, children }) => {
    return (
      <HeaderButton primary={primary} onClick={() => history.push(url)}>
        {children}
      </HeaderButton>
    );
  };



  return (
    <Body>
      <HeaderWrapper>
        <HeaderImagePart>
          <HeaderImage src="/images/Autohub.HeadersLeft.png" />
        </HeaderImagePart>

        <HeaderRightWrapper>
          <HeaderRightPart>
            <HeaderRightPartComment>
              지금 바로 키워드로 검색해보세요! 무엇이든 찾아드립니다.
            </HeaderRightPartComment>

            <HeaderRightSearchPart>
              <SearchInput></SearchInput>
              <BiSearch
                style={{
                  width: "50px",
                  height: "40px",
                  color: "#f11843",
                  position: "relative",
                  right: "80px",
                  top: "5px",
                  cursor: "pointer",
                }}
              />
            </HeaderRightSearchPart>

            <HeaderButtonPart>
              {[["./Hyundai", "현대"],
                ["./Kia", "기아"],
                ["./Bmw", "Bmw"],
                ["./Benz", "벤츠"],
                ["./Genesis", "제네시스"],
              ].map((el, key) => (
                <CarButton key={key} primary url={el[0]}>
                  {el[1]}
